];

// Coordinates for the new red polygon
const redPolygonCoords = [
  { lat: 23.4525, lng: 85.4569 }, // 23°27'09"N 85°27'25"E
  { lat: 23.4453, lng: 85.4525 }, // 23°26'43"N 85°27'09"E
