];

// Coordinates for the new yellow polygon
const yellowPolygonCoords = [
  { lat: 23.4433, lng: 85.4600 }, // 23°26'36"N 85°27'36"E
  { lat: 23.4431, lng: 85.4594 }, // 23°26'34"N 85°27'34"E
  { lat: 23.4430, lng: 85.4594 }, // 23°26'31"N 85°27'34"E
