  { lat: 23.4433, lng: 85.4600 }, // Closing the polygon
];

// Coordinates for Casa Blanca Estate in Rukka, Jharkhand
const casaBlancaCoords = { lat: 23.443576748453125, lng: 85.46080978467886 };

// Coordinates for Ormanji
const ormanjiCoords = { lat: 23.3680, lng: 85.3200 };

const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk",
  });

  const [showJharkhandPolygon, setShowJharkhandPolygon] = useState(true);
  const [showRanchiPolygon, setShowRanchiPolygon] = useState(true);
  const [showNewPolygon, setShowNewPolygon] = useState(true);
  const [showRedPolygon, setShowRedPolygon] = useState(true);
  const [showYellowPolygon, setShowYellowPolygon] = useState(true); // New state for yellow polygon

  return isLoaded ? (
    <GoogleMap
      mapContainerStyle={containerStyle}
      center={center}
      zoom={zoomLevel}
    >
      {/* Polygon covering Jharkhand */}
      {showJharkhandPolygon && (
        <PolygonF
          paths={jharkhandCoords}
          options={{
            fillColor: '#228B22', // Fill color for Jharkhand polygon
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
          onClick={() => setShowJharkhandPolygon(false)} // Click event to hide the Jharkhand polygon
        />
      )}

      {/* Polygon covering Ranchi */}
      {showRanchiPolygon && (
        <PolygonF
          paths={ranchiCoords}
          options={{
            fillColor: '#0000FF', // Fill color for Ranchi polygon
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      )}

      {/* New polygon */}
      {showNewPolygon && (
        <PolygonF
          paths={newPolygonCoords}
          options={{
            fillColor: '#00FF00', // Fill color for the new polygon
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      )}

      {/* Red polygon */}
      {showRedPolygon && (
        <PolygonF
          paths={redPolygonCoords}
          options={{
            fillColor: '#FF0000', // Fill color for the red polygon
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      )}

      {/* Yellow polygon */}
      {showYellowPolygon && (
        <PolygonF
          paths={yellowPolygonCoords}
          options={{
            fillColor: '#FFFF00', // Fill color for the yellow polygon
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      )}

      {/* Marker on Casa Blanca Estate */}
      <MarkerF
        position={casaBlancaCoords}
        title="Casa Blanca Estate, Rukka"
      />

      {/* Marker for Ormanji */}
      <MarkerF
        position={ormanjiCoords}
        title="Ormanji"
      />
    </GoogleMap>
  ) : <></>;
};

export default MapComponent;
